import React from "react";

const contacts = [
  {
    id: 1,
    name: "Leanne Graham",
    email: "leannegraham@abc.com"
  },
  {
    id: 2,
    name: "Ervin Howell",
    email: "ervinhowell@abc.com"
  }
];

function Contact(props) {
  return (
    <div key={props.id}>
      <h3>{props.name}</h3>
      <p>Email: {props.email}</p>
    </div>
  );
}
